import React from 'react'
import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button
} from 'reactstrap';


function ShoppingItems(props) {
    console.log("props of shopping item", props.shoppingItemsData);

    const shoppingItemsCard = props.shoppingItemsData.map((item) =>
        <Card key={item.title.toString()}>
            <CardImg top width="40%" src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />
            <CardBody>
                <CardTitle>{item.title}</CardTitle>
                {/* <CardSubtitle>Card subtitle</CardSubtitle>
            <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText> */}
                <Button onClick={props.onClick(item)}>Button</Button>
            </CardBody>
        </Card>
    )

    return (
        <div>{shoppingItemsCard}</div>
    );
}

export default ShoppingItems;
